CE03 – Materassino acustico sopra pannelli metallici microforati tipo O.R.V. Manufacturing art. Fiberart TD NRE/2264 2LQ

Fornitura e posa in opera, sopra pannelli metallici microforati, di materassino acustico colore nero tipo O.R.V. Manufacturing art. Fiberart TD NRE/2264 2LQ, in fibra di poliestere di origine riciclata certificata ISO 14021, avente le seguenti caratteristiche:
 - dimensioni: 100x2000 mm (±15 mm);
 - spessore: 40 mm;
 - densità: 40 kg/m3;
 - reazione al fuoco: Euroclass B-s2, d0 (EN 13501);
 - conducibilità termica: 0,33 W/mK (EN 12667);
 - stabilità termica: -40 ÷ 100 °C.

Nel prezzo si intendono compresi: posa secondo le quote di progetto, campionatura per approvazione della D.L., rispetto della marcatura CE e Dichiarazione di Prestazione DoP (Reg. UE 305/2011), e ogni onere necessario per consegnare il lavoro finito a regola d'arte.

Fasciatura acustica di canaline per passaggio impianti elettrici

Trattamento dei passaggi di canaline elettriche tra ambienti adiacenti con: 
- avvolgimento delle canaline con uno strato di lana minerale, densità ≥ 50 kg/m3 e sp. ≥ 30 mm; 
- rivestimento in materiale fonoisolante ad alta densità tipo NDA TECSOUND, classe di reazione al fuoco B-s2,d0, massa sup. ≥ 4 kg/m² e sp. ≥ 2 mm;
- nastratura con nastro in alluminio o equivalente intorno a tutto il rivestimento; 
- riempimento della canalina con lana minerale (densità ≥ 50 kg/m3 e sp. ≥ 30 mm) al di sopra dei cavi per una lunghezza pari a 40 cm da entrambi i lati del setto. 

Per prestazioni e relativi disegni esecutivi vedere relazione ed elaborati acustici. 
Qualora in fase di cantiere si riscontrerà la presenza di ulteriori canaline elettriche passanti nei setti rispetto a quelle conteggiate sarà necessario procedere con il medesimo trattamento acustico sopra descritto.
Compreso ogni onere e magistero per dare l'opera finita a perfetta regola d'arte.

Fori passacavi Ø 70 mm e Ø 100 mm attraverso pavimento sopraelevato e solaio

Esecuzione di foro circolare di diametro nominale 70 mm per impianti elettrici e 100 mm per impianti idraulici, comprendente: taglio preliminare del pannello di pavimento sopraelevato con utensile diamantato a secco dotato di aspirazione polveri e posa di protezioni provvisorie; carotaggio diamantato Ø 70 mm e Ø 100 mm su soletta in calcestruzzo armato spessore fino a 0,30 m, con carotatrice a colonna ancorata, adduzione acqua e recupero fanghi; eventuale manicotto in PVC/PP Ø 75 mm e sigillatura periferica per garantire continuità di resistenza al fuoco e di tenuta agli impianti; raccolta carote e fanghi, calo in basso, trasporto e conferimento in centro autorizzato per rifiuti speciali non pericolosi;
pulizia finale, ripristino della sicurezza, oneri di sicurezza D.Lgs 81/08, nolo attrezzature, energia, manodopera specializzata e quanto occorrente per consegnare il lavoro finito a regola d'arte.

